import React from 'react'
import AppBar from '@material-ui/core/AppBar'
import Toolbar from '@material-ui/core/Toolbar'

class NavBar extends React.Component{
    render(){
        return(
           <AppBar>
               <Toolbar>
                   <Button>Login</Button>
                   <Button>Home</Button>
                   <Button>Signup</Button>
                </Toolbar>
            </AppBar>
        )
    }
}

export default NavBar
